(4, '100', 2, 'Queen of Masks', 'Sebuah drama misteri pembalasan dendam mengisahkan pertempuran antara empat sahabat, di mana tiga di antaranya memutuskan untuk menghancurkan hidup salah satunya dengan menuduhnya sebagai pembunuh sepuluh tahun yang lalu!', '2023 | Season 1 | PG-13', NULL, NULL, NULL, NULL, NULL, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/Cover 1@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/Cover 2@3x.jpg', 97, 'N', '2023-07-20 14:25:46', '2023-09-14 16:36:37'),
(5, '100', 2, 'Summer Guys', 'Cerita tentang gairah dan percintaan yang mekar di antara para pemuda yang berjuang keras untuk menghidupkan kembali sebuah bar koktail tua di tepi pantai. Oh Jin Dal-rae adalah pemilik dan satu-satunya bartender dari sebuah bar yang sudah tak terawat bernama "Summer Guys", yang terletak tepat di samping sebuah resor pantai mewah di Pulau Jeju. Meskipun lokasinya bagus, bisnisnya sepi dan Jin Dal-Rae hanya bisa bertahan hidup. Dia merekrut tiga orang pria misterius yang muncul di bar pada suatu hari musim panas, dan tim baru ini berusaha menghidupkan kembali bar yang hampir mati dengan penuh gairah.', '2021 | Season 1 | PG-13', NULL, NULL, NULL, NULL, NULL, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/Summer Guys Cover@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/Summer Guys Cover@3x.jpg', 97, 'N', '2023-07-20 15:55:31', '2023-09-14 16:36:37'),
(6, '38', 2, 'Bungo Stray Dogs S5', 'Akibat jebakan yang disusun oleh "Lima Pertanda Mematikan", Agensi Detektif Bersenjata dianggap sebagai organisasi teroris. Dapatkah mereka menemukan kesempatan untuk melawan dan mengalahkan dalang di balik semua ini?', '2023 | Season 5 | PG-13', NULL, NULL, NULL, NULL, NULL, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/Bungo Stray Dogs Season 5 - Cover@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/Bungo Stray Dogs Season 5 - Cover@3x.jpg', 37, 'N', '2023-07-20 16:49:05', '2023-09-14 16:36:37'),
(7, '39', 2, 'Magnum PI', 'Detektif swasta yang menawan, Thomas Magnum (Jay Hernandez), beserta mitra yang ahli, mantan agen MI6 Juliet Higgins (Perdita Weeks), kembali untuk menangani lebih banyak kasus sulit di Hawaii dalam musim ketiga yang penuh aksi dari Magnum P.I.', '2020 | Season 3 | PG-13', NULL, NULL, NULL, NULL, NULL, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/Magnum PI@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/Magnum PI@3x.jpg', 38, 'N', '2023-07-21 09:13:45', '2023-09-14 16:36:37'),
(8, '99', 4, 'Chasing the Dragon', 'Konten ini milik Celestial Tiger Entertainment (Celestial Movies). Donnie Yen berperan sebagai raja narkoba terkenal di dunia nyata, Crippled Ho, yang datang ke Hong Kong sebagai imigran ilegal pada tahun 1963.', '2017 | Sequels | PG-13', NULL, NULL, NULL, NULL, NULL, 'https://picture.dens.tv/poster/files/lands/vod_410x230/1652244176_land.jpg', 'https://picture.dens.tv/poster/files/lands/1652244176_land.jpg', 2, 'N', '2023-08-07 10:37:25', '2023-08-29 14:46:24'),
(9, '100', 2, 'When My Love Blooms', 'Pada tahun 1993, Jisu dan Jaehyeon, yang pertama kali bertemu di tempat protes dan menjadi cinta pertama satu sama lain. Setelah 26 tahun, Jisu dan Jaehyeon secara tak sengaja bertemu kembali.', '2020 | Season 1 | PG-13 ', NULL, NULL, NULL, NULL, NULL, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/Cover@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/Cover@3x.jpg', 1, 'N', '2023-08-10 15:00:39', '2023-10-11 13:58:22'),
(10, '39', 1, 'Making It S2 MARATHON', 'Para pembuat terbaik dari seluruh penjuru negara menghadapi serangkaian proyek handmade yang harus mereka selesaikan dengan cara unik mereka masing-masing. Saat kompetisi berlangsung, tantangan-tantangan menjadi semakin sulit, dan pembuat yang paling tidak berhasil akan dieliminasi setiap minggunya. Acara ini mencapai puncaknya dalam pertarungan akhir antara dua pembuat terakhir. Berlangsung di suasana luar yang tenang, kepositifan, karakter, dan persahabatan budaya handmade bersinar melalui para host komedi dan para juri yang memberikan dorongan, panduan, dan banyak tawa.', '2018 | Season 2 | PG', '', 0, '', '', '', 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410@3x.jpg', 'http://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x.jpg', 2, 'N', '2023-08-10 15:35:27', '2023-10-11 13:55:22'),
(11, '39', 1, 'Making It Australia S1 MARATHON', 'Dari keramik dan pyrography hingga ukiran, merajut, dan bahkan lampu gantung Chris Hemsworth, Making It Australia adalah seri kreatif dan DIY baru yang mengumpulkan Para Pembuat paling berbakat dari negara ini untuk memamerkan kejeniusan artistik mereka. Acara ini akan dipandu oleh pelawak, aktor, dan penulis Susie Youssef serta pelawak Harley Breen. Penuh kebahagiaan dan inspirasi, seri ini akan merayakan kekuatan transformatif seni dan kerajinan.', '2021 | Season 1 | PG', '', 0, '', '', '', 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 2@3x.jpg', 'http://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (1).jpg', 3, 'N', '2023-08-10 16:51:51', '2023-10-11 13:55:34'),
(12, '38', 1, 'Blood Blockade Battlefront MARATHON', 'Suatu hari, Kota New York seperti yang kita kenal tiba-tiba menghilang dalam kabut misterius. Kini dikenal sebagai Hellsalem''s Lot, tempat ini telah menjadi suatu tempat di mana dunia lain yang tak terbayangkan terhubung dengan realitas kita. Keseimbangan dalam dunia baru ini dilindungi oleh sebuah masyarakat rahasia yang dikenal sebagai Libra. Leo, seorang jurnalis dan fotografer yang tiba di kota tersebut, tiba-tiba direkrut untuk bergabung dalam barisan mereka.', '2015 | Season 1 | PG-13', '', 0, '', '', '', 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 2@3x (1).jpg', 'http://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (3).jpg', 4, 'N', '2023-08-10 17:24:47', '2023-10-11 13:49:37'),
(13, '39', 1, 'Chicago Med S7 MARATHON', 'Bekerja di Unit Gawat Darurat adalah pekerjaan yang penuh tekanan, tetapi juga sangat memuaskan. Dapatkan gambaran melalui Chicago Med S7, sebuah drama medis Amerika yang memperlihatkan para dokter dan perawat di Gaffney Chicago Medical Center berjuang untuk menyelamatkan nyawa pasien mereka sambil mengatasi masalah pribadi mereka sendiri.', '2021 | Season 7 | PG-13', '', 0, '', '', '', 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 2@3x (2).jpg', 'http://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (5).jpg', 5, 'N', '2023-08-10 17:29:34', '2023-10-11 13:55:44'),
(14, '39', 1, 'SurrealEstate S1 MARATHON', 'Ikuti agen properti Luke Roman dan sebuah tim elit spesialis di SurrealEstate untuk menangani kasus-kasus yang tidak bisa ditangani oleh orang lain: rumah-rumah yang berhantu dan dirasuki yang secara harfiah membuat calon pembeli lari ketakutan.', '2021 | Season 1 | PG-13', '', 0, '', '', '', 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/Surreal Estate@3x.jpg', 'http://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (7).jpg', 6, 'N', '2023-08-10 17:35:02', '2023-10-11 13:55:55'),
(15, '100', 2, 'Longing For You', 'Seorang detektif yang telah mencari pelaku dalam kasus pembunuhan mengungkap rahasia keluarga yang tersembunyi. ', 'Setiap Kamis dan Jum''at  Jam 20.15 | 2023 | Season 1 | PG-13', 'Na In-woo, Kim Ji-eun, Kwon Yul, Bae Jong-ok, Lee Kyu-han, dan Jung Sang-hoon', 2023, 'Setiap Kamis & Jum''at | 20:15 WIB', '60 menit', 'PG - 13', 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 Cover@3x.jpg', 'http://picture.dens.tv/wp/img/catchup_banner/1280x720/1280 Cover@3x.jpg', 14, 'N', '2023-08-10 17:47:03', '2023-10-11 13:58:36'),
(16, '44', 4, 'The Great Train Robbery', 'Drama berdurasi dua bagian ini menggambarkan Perampokan Kereta Api Besar pada tanggal 8 Agustus 1963, pertama-tama dari sudut pandang para perampok dan kemudian dari sudut pandang polisi yang berusaha menyelidikinya.', '', '', 0, '', '', '', 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 b@3x.jpg', 'http://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (9).jpg', 9, 'N', '2023-08-15 14:33:09', '2023-10-11 13:57:45'),
(17, '44', 4, 'Beverly Hills Cop', '"Beverly Hills Cop" adalah film komedi aksi buddy cop Amerika tahun 1984 yang dibintangi oleh Eddie Murphy sebagai Axel Foley, seorang polisi pintar jalanan dari Detroit yang berkunjung ke Beverly Hills', '-', '', 0, '', '', '', 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 b@3x (6).jpg', 'http://picture.dens.tv/wp/img/catchup_banner/1280x720/1695787049_catchup_banner.jpg', 10, 'N', '2023-08-15 15:04:26', '2023-10-11 13:57:52'),
(18, '44', 4, 'The Secret Agent', 'Sebuah adaptasi yang penuh ledakan dan penuh dukacita dari novel klasik Joseph Conrad tentang terorisme, spionase, dan pengkhianatan.', '-', '', 0, '', '', '', 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 b@3x (3).jpg', 'http://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (16).jpg', 11, 'N', '2023-08-15 16:18:37', '2023-10-11 13:58:01'),
(19, '87', 4, 'A Murder of Crows', 'Inspektur Martin Brühl adalah seorang penyelidik yang secara psikologis sangat tidak stabil dan telah bergantung pada obat psikotropika dalam beberapa waktu, serta berada di bawah pengawasan konstan', '-', '', 0, '', '', '', 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 @3x.jpg', 'http://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (21).jpg', 13, 'N', '2023-08-16 13:20:38', '2023-10-11 13:59:15'),
(20, '100', 2, 'Earth Arcade 2', 'Sebuah variasi petualangan aksi hibrida yang benar-benar baru! Sebuah konsep baru variasi petualangan aksi hibrida di mana 4 pejuang bermain game dan menjalankan misi untuk melampaui ruang dan waktu, dengan tujuan menangkap kelinci bulan yang lolos ke Bumi. Bergabunglah dengan para pejuang Bumi dalam petualangan yang tak terduga ke tanah musim dingin, Finlandia, dan pulau para Dewa, Bali.', '', '', 0, '', '', '', 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 Cover@3x (1).jpg', 'http://picture.dens.tv/wp/img/catchup_banner/1280x720/1280 Cover@3x (1).jpg', 15, 'N', '2023-08-16 16:19:49', '2023-10-11 13:58:51'),
(21, '39', 2, 'Accused', 'Menceritakan tentang orang biasa yang terperangkap dalam situasi luar biasa, di mana satu kesalahan belokan mengarah ke yang lain, sampai akhirnya terlambat untuk berbalik.', '-', '', 0, '', '', '', 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410@3x (6).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (25).jpg', 7, 'N', '2023-08-16 16:27:33', '2023-10-11 13:56:06'),
(22, '60', 1, 'LIVE WCCB - Emmanuel Rodriguez vs. Melvin Lopez', 'Channel : Fight Sports <br>\nTayang : 12 Agustus 2023 <br>\nSiaran LANGSUNG pada tanggal 13 Agustus, dari MGM National Harbor di Oxon Hill, Maryland, AS, pertarungan utama antara dua petinju kelas bantam teratas dunia, Emmanuel Rodriguez dan Melvin Lopez, akan menentukan Juara Dunia Kelas Bantam IBF. Rodriguez (21-2) adalah mantan juara dunia, masuk pertarungan setelah kemenangan atas Gary Antonio Russell yang belum terkalahkan, dan saat ini menduduki peringkat #2 di dunia menurut IBF. Lawannya, Melvin Lopez (29-1), telah memenangkan 8 pertarungan beruntun dengan 7 di antaranya dimenangkan dengan stoppage, dan berada di peringkat #2 oleh WBA dan #3 oleh WBO dan IBF. Dengan kedua petinju berada di peringkat 3 besar dunia dalam divisi tersebut, pertarungan ini benar-benar bisa dimenangkan oleh siapa saja. Saksikan Rodriguez vs. Lopez untuk Juara Dunia Kelas Bantam IBF LANGSUNG pada 13 Agustus, hanya di FIGHT SPORTS.', '', '', 0, '', '', '', 'http://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 a@3x (8).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (28).jpg', 12, 'N', '2023-08-16 16:43:09', '2023-10-11 13:59:37'),
(23, '39', 2, 'The Masked Dancer U.K. S2', 'Versi Inggris dari kompetisi bernyanyi/permainan tebak-tebakan asal Korea Selatan yang populer. Para selebriti tampil memakai kostum rumit untuk menyembunyikan identitas mereka dalam kompetisi - bisakah kamu menebak siapa yang ada di balik masker?', 'Episode 1', '', 0, '', '', '', 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 Cover@3x (2).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280 Cover@3x (2).jpg', 8, 'N', '2023-08-24 13:39:07', '2023-10-11 13:56:20'),
(24, '39', 2, 'Crime Scene Kitchen S2 ', 'Saatnya para juru masak mengeluarkan yang terbaik dan tidak melewatkan satu kejahatan pun. Siapkan keterampilan detektifmu, dan bersiaplah untuk final yang menegangkan yang tidak ingin kamu lewatkan.', 'Finale', NULL, NULL, NULL, NULL, NULL, 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 Cover@3x (3).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280 Cover@3x (3).jpg', 38, 'N', '2023-08-24 14:05:41', '2023-09-14 16:36:37'),
