(36, '39', 1, 'NCIS S19 Ep. 1-21 MARATHON', 'Dengan humor yang banyak, NCIS adalah drama yang berfokus pada dinamika tim yang terkadang rumit dan selalu lucu yang dipaksa untuk bekerja sama dalam situasi stres tinggi.', '', 'Mark Harmon, Sean Murray, Wilmer Valderrama', 2021, '22 - 24 September | Jumat - Minggu | mulai 18:00 WIB', '36 jam', 'PG-13', 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410@3x (17).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (38).jpg', 26, 'N', '2023-09-22 16:09:14', '2023-10-11 13:57:19'),
(37, '38', 2, 'Migi & Dali ', 'Dalam cerita misteri ini, Migi dan Dali adalah saudara kembar identik yang berhasil diadopsi oleh pasangan lansia yang hanya ingin mengadopsi satu anak.', '', 'Shun Horie, Ayumu Murase', 2023, 'Setiap Senin | 21:00 WIB', '30 Menit', 'PG-13', 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 Cover@3x (5).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280 Cover@3x (5).jpg', 2, 'Y', '2023-10-11 14:48:03', '2023-10-11 15:04:39'),
(38, '38', 2, 'Paradox Live THE ANIMATION', 'Empat tim bertarung memperebutkan posisi teratas dengan genre musik mereka sendiri dalam "Paradox Live" yang misterius, saat motif mereka sebenarnya perlahan terungkap…\n', '', 'Gakuto Kajiwara, Ryota Takeuchi, Yusuke Kobayashi', 2023, 'Setiap Rabu | 21:00 WIB', '30 Menit', 'PG', 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 Cover@3x (6).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280 Cover@3x (6).jpg', 3, 'Y', '2023-10-11 15:17:34', '2023-10-11 15:17:34'),
(39, '39', 1, 'Law and Order: Special Victims Unit S23 MARATHON', 'Saat penyelidikan terhadap skema seks untuk perumahan meluas, kesetiaan Benson kepada Garland diuji. ', '', 'Mariska Hargitay, Christopher Meloni, Ice-T', 2021, '6 Oktober | Jumat - Minggu | Mulai 17:00 WIB', '36 Jam', 'PG-13', 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 Cover@3x (7).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280 Cover@3x (7).jpg', 4, 'N', '2023-10-11 16:05:04', '2023-10-18 15:05:50'),
(40, '60', 1, 'LIVE WCCB - Kim Clavel vs. Evelin Bermudez', 'Kejuaraan Dunia WBO & IBF akan dipertaruhkan ketika Kim Clavel naik ring di rumahnya di Laval, Quebec, Kanada untuk menantang juara Evelin Bermudez dari Argentina.', '', 'Kim Clavel, Evelin Bermudez', 2023, '8 Oktober | Minggu | 6:00 WIB', '3 1/2 Jam', 'Not Rate', 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410@3x (18).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (39).jpg', 5, 'N', '2023-10-11 16:16:51', '2023-10-18 15:09:50'),
(41, '123', 1, 'LIVE Women''s Super League: Manchester United v Arsenal', 'Manchester United memenangkan kedua pertemuan melawan Arsenal musim lalu, jadi The Gunners akan berusaha membalas dendam di pertandingan ini. ', '', '-', 2023, '7 Oktober | Sabtu | 01:25 WIB', '3 Jam', 'Not Rate', 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 Manchester United v Arsenal@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280 Manchester United v Arsenal@3x.jpg', 6, 'N', '2023-10-11 16:25:54', '2023-10-18 15:10:00'),
(42, '100', 2, 'EVILIVE', 'Kisah seorang pengacara sederhana yang menyerah pada keinginan dan berubah menjadi penjahat elit.', '', 'Shin Ha-kyun, Kim Young-kwang, Shin Jae-ha  Han Beom-jae', 2023, 'Setiap Sabtu & MInggu', '1 Jam', 'PG-13', 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 COVER@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280 COVER@3x.jpg', 7, 'Y', '2023-10-18 10:50:44', '2023-10-18 11:11:37'),
(43, '39', 1, 'The Masked Singer U.K. S3 MARATHON', 'Lima penyanyi naik ke panggung dengan menyamar saat para juri mencoba menebak selebriti misterius yang tampil dalam kostum rumit tersebut.', '', 'Mo Gilligan, Davina McCall, Rita Ora, Jonathan Ross, Joel Dommett', 2021, '13 Oktober | Jumat - Minggu | dari 17:00 WIB', '36 jam', 'Not Rate', 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410@3x (19).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280@3x (40).jpg', 8, 'Y', '2023-10-18 11:29:26', '2023-10-18 11:29:26'),
(44, '38', 2, 'My New Boss is Goofy', 'Seorang pekerja kantoran muda berganti pekerjaan karena pelecehan dari atasan sebelumnya. Perilaku konyol atasannya dengan cepat menghilangkan kekhawatirannya dan membuatnya lega.', '', 'Yuuichirou Umehara, Koutaro Nishiyama, Tomokazu Sugita  Mitsuo Aoyama', 2023, 'Setiap Sabtu | 22:00 WIB', '30 menit', 'PG', 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 Cover@3x (8).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280 Cover@3x (8).jpg', 4, 'Y', '2023-10-19 15:56:43', '2023-10-19 15:56:43'),
(45, '39', 2, 'The Masked Singer U.K. S4', 'Para artis selebriti yang mengenakan kostum rumit untuk menyembunyikan identitas mereka berkompetisi - dapatkah Anda menebak siapa yang ada di balik topeng tersebut?', '', 'Mo Gilligan, Davina McCall, Rita Ora, Jonathan Ross, Joel Dommett', 2023, 'Setiap Kamis | 20:20 WIB', '1 jam', 'Not Rate', 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410 CoVER@3x.jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280 Cover@3x (9).jpg', 5, 'Y', '2023-10-19 16:13:36', '2023-10-19 16:13:36'),
(46, '38', 1, 'Attack on Titan S3 Ep. 1-12 MARATHON', 'Musim ini mengikuti Eren dan rekan-rekan prajuritnya dari Survey Corps yang masih berjuang untuk bertahan hidup melawan para Titan yang menakutkan.', '', 'Yûki Kaji, Yui Ishikawa, Hiroshi Kamiya', 2019, '21 Oktober | Sabtu | dari 13:30 WIB', '25 menit', '16 and a', 'https://picture.dens.tv/wp/img/catchup_thumbnail/410x230/410@3x (20).jpg', 'https://picture.dens.tv/wp/img/catchup_banner/1280x720/1280 @3x.jpg', 6, 'Y', '2023-10-19 16:25:22', '2023-10-19 16:25:22'),
